De que sede te comunicas?
la 33
floresta
pedregal
sabaneta parque
sabaneta avenida
almendros
[object Object]
(ctx, {fallBack}) => {
        const userInput = ctx.body.toLowerCase();
        const sedes = [
            'la 33',
            'floresta',
            'pedregal',
            'sabaneta parque',
            'sabaneta avenida',
            'almendros'];

        const sedevalida = sedes.some(sede => userInput.includes(sede.toLowerCase()));

        if(!sedevalida){
            return fallBack()
        }
            console.log('mensaje entrante', ctx.body)
    }
